#include <iostream>
#include <string>
#include <vector>
#include <cctype> // For std::tolower

std::string markdown_to_html(const std::string& md) {
    std::string html;
    int prev_ch = 0; // Pointer for the current character in the markdown string

    for (char ch : md) {
        if (ch == '{') {
            html += "<span class=\"markdown-attr\">";
            html += "{" + std::to_string(prev_ch);
            html += "} ";
            html += ch;
            html += "</span>";
            prev_ch = ch;
        } else if (ch == '}') {
            html += "</span>";
        } else if (std::isalpha(ch)) { // Check for uppercase or lowercase letters
            html += "<span class=\"markdown-symbol\">" + std::toupper(ch) + "</span>";
        } else if (std::isspace(ch)) {
            continue;
        } else {
            html += ch;
        }

        if (ch != ' ') {
