When using TypeScript to write code, you can use the `type` keyword along with a union or interface declaration to indicate that certain values might have various possible types, but in practice, they will always conform to a single type.

Here's an example:

```typescript
// Define an interface for Person
interface Person {
  name: string;
  age: number;
}

// An object representing an employee
const employee: Record<string, any> = {
  firstName: "John",
  lastName: "Doe",
  position: "Manager",
  department: "Sales"
};

// An object representing a manager
const manager: Partial<Person> = {
  ...employee,
  title: "Chief Executive Officer (CEO)",
  role: "CEO",
  departments: ["Finance", "HR"]
};
```

In this example:
- The `Person` interface specifies that each person has two properties (`name` and `age`). In reality, all people will have exactly these two properties.
- The `manager` object uses the `Partial` function to create a new object with just the `firstName`, `lastName`, and `title`. These values are guaranteed to be present because they are specified as part of the `person` object. The rest (`position`, `role`, and `departments`) are optional and will default to undefined if not explicitly set.

This approach helps TypeScript enforce constraints on your types, ensuring that the values being assigned adhere to specific requirements while allowing flexibility where necessary.

