To determine whether an integer `n` is a power of three without using loops or recursion, we can use logarithms. Specifically, since \(3\) raised to any positive exponent will result in a number greater than or equal to \(3\) (which is always true for any positive base), we need to find the largest integer \(x\) such that \(3^x \leq n < 3^{x+1}\). This can be done by taking the base-3 logarithm (\(\log_3(n)\)) and then checking if the result falls within the range `[0, x]`.

Here's a Java implementation:

```java
public class Solution {
    public boolean isPowerOfThree(int n) {
        // If n is less than or equal to 0, it cannot be a power of three
        if (n <= 0) return false;

        // Calculate the largest power of 3 less than n
        int x = (int) Math.log(n) / Math.log(3);

        // Check if n is a power of 3 by verifying if log(n) is within the range [0, x]
        return x > 0 && n == Math.pow(3, x);
    }
}
```

This solution works as follows:

1. **Base Case**: If \( n \) is less than or equal to 0, it cannot be a power of three, so we return false.

2. **Calculate Logarithm**: We calculate the largest integer \( x \) such that \( 3^x \leq n \).

3. **Check Power of Three Condition**: After finding \( x \), we check if \( n \) is equal to \( 3^x \). If they match, then \( n \) is a power of three; otherwise, it is not.

This approach ensures that the solution uses constant space and performs logarithmic time complexity.

